import React from "react";
import { Table } from "reactstrap";

export const ResultTable = (props) => {
  return <Table>
    <thead>
      <tr>
        <th>#</th>
        <th>First Name</th>
        <th>Last Name</th>
        <th>Username</th>
      </tr>
    </thead>
    <tbody>
      {props.results.map(result => <Row data={result} />)}
    </tbody>
  </Table>
}

export const Row = (props) => {
  return <tr></tr>

}
